INSERT INTO `categories` (`id`, `ctitle`, `carticle`, `curl`, `cimage`, `created_at`, `updated_at`) VALUES
(1, 'Gas Grill', 'Gas-fueled grills typically use propane or butane (liquified petroleum gas) or natural gas as their fuel source, with the gas flame either cooking food directly or heating grilling elements which in turn radiate the heat necessary to cook food. Gas grills are available in sizes ranging from small, single steak grills up to large, industrial sized restaurant grills which are able to cook enough meat to feed a hundred or more people. Some gas grills can be switched between using liquified petroleum gas and natural gas fuel, although this requires physically changing key components including burners and regulator valves.', 'gas-grill', 'gas-grill.jpg', '2019-11-29 00:00:00', '2019-12-21 16:23:28'),
(3, 'Charcoal Grill', '\r\nCharcoal grills use either charcoal briquettes or natural lump charcoal as their fuel source.[12] When burned, the charcoal will transform into embers radiating the heat necessary to cook food.\r\n\r\nThere is contention among grilling enthusiasts on what type of charcoal is best for grilling. Users of charcoal briquettes emphasize the uniformity in size, burn rate, heat creation, and quality exemplified by briquettes. Users of all-natural lump charcoal emphasize its subtle smoky aromas, high heat production, and the lack of binders and fillers often present in briquettes.', 'charcoal-grill', 'Charcoal-Grill.jpg', '2019-11-29 00:00:00', '2019-11-29 00:00:00'),
(4, 'Smokers', 'The main characteristics of the offset smoker are that the cooking chamber is usually cylindrical in shape, with a shorter, smaller diameter cylinder attached to the bottom of one end for a firebox. To cook the meat, a small fire is lit in the firebox, where airflow is tightly controlled. The heat and smoke from the fire are drawn through a connecting pipe or opening into the cooking chamber.\r\n\r\nThe heat and smoke cook and flavor the meat before escaping through an exhaust vent at the opposite end of the cooking chamber. Most manufacturers\' models are based on this simple but effective design, and this is what most people picture when they think of a \"BBQ smoker\". Even large capacity commercial units use this same basic design of a separate, smaller fire box and a larger cooking chamber.[16]', 'smokers', 'Smokers.jpg', '2019-11-29 00:00:00', '2019-12-21 16:31:03'),
(5, 'Wood Chips', 'Woodchips can also be used to infuse flavor and enhance the smoky taste to barbecued meats and vegetables. Several different species of wood can be used depending on the type of flavor wanted. For a mild, sweet fruity flavor, apple wood can be used while hickory gives a smoky, bacon-like flavor. Other different types of wood used are cherry, mesquite and pecan.', 'wood-chips', 'Wood-Chips.jpg', '2019-11-29 00:00:00', '2019-11-29 00:00:00'),
(6, 'Knives', 'A tool with a cutting edge or blade attached to a handle. Mankind\'s first tool, knives were used at least two-and-a-half million years ago, as evidenced by the Oldowan tools.[2][3] Originally made of rock, bone, flint, and obsidian, over the centuries, in step with improvements in metallurgy or manufacture, knife blades have been made from bronze, copper, iron, steel, ceramics, and titanium. Most modern knives have either fixed or folding blades; blade patterns and styles vary by maker and country of origin.', 'knives', 'knives.jpg', '2019-11-29 00:00:00', '2019-11-29 00:00:00'),
(11, 'Charcoal', 'Charcoal is a lightweight black carbon residue produced by removing water and other volatile constituents from animal and plant materials. Charcoal is usually produced by slow pyrolysis—the heating of wood or other organic materials in the absence of oxygen. This process is called charcoal burning. The finished charcoal consists largely of carbon.', 'charcoal', 'charcoal.jpg', '2019-11-30 00:00:00', '2019-11-30 00:00:00'),
(12, 'Accessories', 'Cooking or cookery is the art, technology, science and craft of preparing food for consumption. Cooking techniques and ingredients vary widely across the world, from grilling food over an open fire to using electric stoves, to baking in various types of ovens, reflecting unique environmental, economic, and cultural traditions and trends. ', 'accessories', 'Accessories.jpg', '2019-11-30 00:00:00', '2019-11-30 00:00:00'),
(13, 'Sauces And Rubs', 'Grill rubs are a blend of spices and herbs used to flavor infuse different meat before you grill. BBQ rubs are usually dry, although they can be wet, or paste-like. Grill rubs can be used on chicken, steak, pork, fish, shrimp, or turkey.', 'sauces-and-rubs', 'sauces-and-rubs.jpg', '2019-11-30 00:00:00', '2019-11-30 00:00:00'),
(26, 'fdgfdgfdgfgdgf', 'The main characteristics of the offset smoker are that the cooking chamber is usually cylindrical in shape, with a shorter, smaller diameter cylinder attached to the bottom of one end for a firebox. To cook the meat, a small fire is lit in the firebox, where airflow is tightly controlled. The heat and smoke from the fire are drawn through a connecting pipe or opening into the cooking chamber.', 'fdgfdgfdgfgdgf', '22.12.2019.15.00.54-grid-3227459_1920.jpg', '2019-12-22 15:00:55', '2019-12-22 15:00:55'),
(28, 'werewwer', '<p>werweewrewr</p>', 'werewwer', '08.01.2020.17.18.04-charcoal-home.jpg', '2020-01-08 17:18:04', '2020-01-08 17:18:04');

