(1, 1, 'About Our Company ', '\r\n      \r\n      <!-- Content Block\r\n      ============================================-->\r\n     <section class=\"content-block default-bg\">\r\n        <!-- Container -->\r\n        <div class=\"container no-pad-t\">\r\n\r\n          <!-- Row -->\r\n          <div class=\"row\">\r\n\r\n            <!-- Main Col -->\r\n            <div id=\"main-col\" class=\"col-sm-8 col-md-8 mgb-30-xs\">\r\n <h4 class=\"case-c\">About Our Company</h4>\r\n\r\n                <p>Edward G. Kingsford invented the modern charcoal briquette.[5] Kingsford was a relative of Henry Ford who assigned him the task of establishing a Ford auto parts plant and sawmill in northern Michigan, a challenge that Kingsford embraced. The local community grew and was named Kingsford in his honor. Kingsford noticed that Ford\'s Model T production lines were generating a large amount of wood scraps that were being discarded. He suggested to Ford that a charcoal manufacturing facility be established next to the assembly line to process and sell charcoal under the Ford name at Ford dealerships. Several years after Kingsford\'s death, the chemical company was sold to local businessmen and renamed the Kingsford Chemical Company.</p>\r\n                <hr>\r\n                \r\n            </div>\r\n            <!-- /Main Col -->\r\n            <div class=\"col-sm-4 col-md-4\">\r\n\r\n              <!-- Side Widget -->\r\n              <div class=\"side-widget\">\r\n              \r\n                <h5 class=\"boxed-title\">Our location</h5>\r\n                \r\n                <!-- fader -->\r\n                <div class=\"fader mgb-20\">\r\n                  <img src=\"lib/Template/images/map.png\" alt=\"\">\r\n                  <!-- hidden -->\r\n                  <div class=\"fader-hidden pcolor-bg white\">\r\n                    <!-- stuff to be revealed here ! -->\r\n                    <div class=\"vcenter align-center\">\r\n                      <div class=\"vce