INSERT INTO `products` (`id`, `categorie_id`, `ptitle`, `particle`, `purl`, `pimage`, `price`, `created_at`, `updated_at`) VALUES
(13, 1, 'Weber Q3200', 'Gas-fueled grills typically use propane or butane (liquified petroleum gas) or natural gas as their fuel source, with the gas flame either cooking food directly or heating grilling elements which in turn radiate the heat necessary to cook food. Gas grills are available in sizes ranging from small, single steak grills up to large, industrial sized restaurant grills which are able to cook enough meat to feed a hundred or more people. Some gas grills can be switched between using liquified petroleum gas and natural gas fuel, although this requires physically changing key components including burners and regulator valves.', 'weber-q3200', 'weber-q3200.jpg', '450.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(14, 1, 'Camptown MIAMI Chef 3B 25790', 'The majority of gas grills follow the cart grill design concept: the grill unit itself is attached to a wheeled frame that holds the fuel tank. The wheeled frame may also support side tables, storage compartments, and other features.', 'camptown-miami-chef-3b-25790', 'camptown-miami-chef-3b-25790.jpg', '569.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(15, 1, 'Char-Broil Patio Bistro 240', 'A recent trend in gas grills is for manufacturers to add an infrared radiant burner to the back of the grill enclosure. This radiant burner provides an even heat across the burner and is intended for use with a horizontal rotisserie. A meat item (whole chicken, beef roast, pork loin roast) is placed on a metal skewer that is rotated by an electric motor. Smaller cuts of meat can be grilled in this manner using a round metal basket that slips over the metal skewer.', 'char-broil-patio-bistro-240', 'char-broil-patio-bistro-240.jpg', '978.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(16, 1, 'Char-Broil Professional Tru-Infrared ', 'Another type of gas grill gaining popularity is called a flattop grill. According to Hearth and Home magazine, flattop grills \"on which food cooks on a griddlelike surface and is not exposed to an open flame at all\" is an emerging trend in the outdoor grilling market.[10]\r\n\r\nA small metal \"smoker box\" containing wood chips may be used on a gas grill to give a smoky flavor to the grilled foods. Barbecue purists would argue that to get a true smoky flavor (and smoke ring) the user has to cook low and slow, indirectly and using wood or charcoal; gas grills are difficult to maintain at the low temperatures required (~225-250 °F), especially for extended periods.[citation needed]', 'char-broil-professional-tru-infrared ', 'char-broil-professional-tru-infrared.jpg', '236.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(17, 1, 'Camptown KENTUCKY MULTI CHEF 14551 Camptown', 'The majority of gas grills follow the cart grill design concept: the grill unit itself is attached to a wheeled frame that holds the fuel tank. The wheeled frame may also support side tables, storage compartments, and other features.\r\n\r\nA recent trend in gas grills is for manufacturers to add an infrared radiant burner to the back of the grill enclosure. This radiant burner provides an even heat across the burner and is intended for use with a horizontal rotisserie. A meat item (whole chicken, beef roast, pork loin roast) is placed on a metal skewer that is rotated by an electric motor. Smaller cuts of meat can be grilled in this manner using a round metal basket that slips over the metal skewer.', 'camptown-kentucky-multi-chef-14551', 'camptown-kentucky-multi-chef-14551.jpg', '779.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(18, 3, 'Barbecook QuickStart', 'Charcoal grills use either charcoal briquettes or natural lump charcoal as their fuel source.[12] When burned, the charcoal will transform into embers radiating the heat necessary to cook food.\r\n\r\nThere is contention among grilling enthusiasts on what type of charcoal is best for grilling. Users of charcoal briquettes emphasize the uniformity in size, burn rate, heat creation, and quality exemplified by briquettes. Users of all-natural lump charcoal emphasize its subtle smoky aromas, high heat production, and the lack of binders and fillers often present in briquettes.', 'barbecook-quick-start', 'barbecook-quick-start.jpg', '132.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(19, 3, 'Australia Chef', 'There is contention among grilling enthusiasts on what type of charcoal is best for grilling. Users of charcoal briquettes emphasize the uniformity in size, burn rate, heat creation, and quality exemplified by briquettes. Users of all-natural lump charcoal emphasize its subtle smoky aromas, high heat production, and the lack of binders and fillers often present in briquettes.\r\n\r\nThere are many different charcoal grill configurations. Grills can be square, round, or rectangular, some have lids while others do not, and they may or may not have a venting system for heat control. The majority of charcoal grills, however, fall into the following categories:', 'australia-chef', 'australia-chef.jpg', '95.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(20, 3, 'Weber One Touch Original 47', 'The simplest and most inexpensive of charcoal grills, the brazier grill is made of wire and sheet metal and composed of a cooking grid placed over a charcoal pan. Usually the grill is supported by legs attached to the charcoal pan. The brazier grill does not have a lid or venting system. Heat is adjusted by moving the cooking grid up or down over the charcoal pan. Even after George Stephen invented the kettle grill in the early 1950s, the brazier grill remained a dominant charcoal grill type for a number of years. Brazier grills are available at most discount department stores during the summer.[citation needed]', 'weber-one-touch-original-47', 'weber-one-touch-original-47.jpg', '215.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(21, 3, 'MCZ Sunday', 'The square charcoal grill is a hybrid of the brazier and the kettle grill. It has a shallow pan like the brazier and normally a simple method of adjusting the heat, if any. However, it has a lid like a kettle grill and basic adjustable vents. The square charcoal grille is, as expected, priced between the brazier and kettle grill, with the most basic models priced around the same as the most expensive braziers and the most expensive models competing with basic kettle grills. These grills are available at discount stores and have largely displaced most larger braziers. Square charcoal grills almost exclusively have four legs with two wheels on the back so the grill can be tilted back using the handles for the lid to roll the grill. More expensive examples have baskets and shelves mounted on the grill.', 'mcz-Sunday', 'mcz-Sunday.jpg', '47.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(22, 3, 'Weber Go Anywhere', 'The traditional Japanese hibachi is a heating device and not usually used for cooking. In English, however, \"hibachi\" often refers to small cooking grills typically made of aluminum or cast iron, with the latter generally being of a higher quality. Owing to their small size, hibachi grills are popular as a form of portable barbecue. They resemble traditional, Japanese, charcoal-heated cooking utensils called shichirin.', 'weber-go-anywhere', 'weber-go-anywhere.jpg', '145.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(23, 4, 'MECO 22005', 'Smoking is the process of flavoring, browning, cooking, or preserving food by exposing it to smoke from burning or smoldering material, most often wood. Meat, fish, and lapsang souchong tea are often smoked.\r\n\r\nIn Europe, alder is the traditional smoking wood, but oak is more often used now, and beech to a lesser extent. In North America, hickory, mesquite, oak, pecan, alder, maple, and fruit-tree woods, such as apple, cherry, and plum, are commonly used for smoking. Other biomass besides wood can also be employed, sometimes with the addition of flavoring ingredients. Chinese tea-smoking uses a mixture of uncooked rice, sugar, and tea, heated at the base of a wok.\r\n\r\n', 'meco-22005', 'meco-22005.jpg', '321.00', '2019-12-02 00:00:00', '2019-12-04 00:00:00'),
(24, 4, 'Char-Broil 8071550 ', 'Some North American ham and bacon makers smoke their products over burning corncobs. Peat is burned to dry and smoke the barley malt used to make whisky and some beers. In New Zealand, sawdust from the native manuka (tea tree) is commonly used for hot smoking fish. In Iceland, dried sheep dung is used to cold-smoke fish, lamb, mutton and whale.', 'char-broil-8071550 ', 'char-broil-8071550.jpg', '552.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(25, 4, 'RANGER PELLET GRILL Traeger', 'Historically, farms in the Western world included a small building termed the \"smokehouse\", where meats could be smoked and stored. This was generally well-separated from other buildings both because of the fire danger and because of the smoke emanations; the smoking of food could possibly introduce polycyclic aromatic hydrocarbons which may lead to an increased risk of some types of cancer; however, this association is still being debated. [1][2][3][4][5][disputed – discuss]', 'ranger-pellet-grill-traeger', 'ranger-pellet-grill-traeger.jpg', '1011.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(26, 4, 'Weber Smokey Mountain 37', '\r\n\r\n\r\n\r\nSmoking can be done in four ways: cold smoking, warm smoking, hot smoking, and through the employment of \"liquid smoke\".[6] However, these methods of imparting smoke only affect the food surface, and are unable to preserve food, thus, smoking is paired with other microbial hurdles, such as chilling and packaging, to extend food shelf-life.[6]', 'weber-smokey-mountain-37', 'weber-smokey-mountain-37.png', '1241.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(27, 4, 'Char-Broil Big Easy 13201834', 'The smoking of food likely dates back to the paleolithic era.[7][8] As caves or simple huts lacked chimneys, these dwellings would probably have become very smoky. It is supposed that early humans would hang meat up to dry and out of the way of pests, thus accidentally becoming aware that meat that was stored in smoky areas acquired a different flavor, and was better preserved than meat that simply dried out. This process was later combined with pre-curing the food in salt or salty brine, resulting in a remarkably effective preservation process that was adapted and developed by numerous cultures around the world.[9] Until the modern era, smoking was of a more \"heavy duty\" nature as the main goal was to preserve the food. Large quantities of salt were used in the curing process and smoking times were quite long, sometimes involving days of exposure.[7]', 'char-broil-big-easy-13201834', 'char-broil-big-easy-13201834.jpg', '2453.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(28, 5, 'Smoking British Wood Chips (Apple)', 'Hot smoking exposes the foods to smoke and heat in a controlled environment such as a smoker oven or smokehouse. Hot smoking requires the use of a smoker which generates heat either from a charcoal base, heated element within the smoker or from a stove-top or oven; food is hot smoked by cooking and flavoured with wood smoke simultaneously.[10] Like cold smoking, the item may be hung first to develop a pellicle; it is then smoked from 1 hour to as long as 24 hours. Although foods that have been hot smoked are often reheated or further cooked, they are typically safe to eat without further cooking. Hams and ham hocks are fully cooked once they are properly smoked, and they can be eaten as is without any further preparation. Hot smoking usually occurs within the range of 52 to 80 °C (126 to 176 °F).[11] When food is smoked within this temperature range, foods are fully cooked, moist, and flavorful. If the smoker is allowed to get hotter than 85 °C (185 °F), the foods will shrink excessively, buckle, or even split. Smoking at high temperatures also reduces yield, as both moisture and fat are cooked away.', 'smoking-british-wood-chips-apple', 'smoking-british-wood-chips-apple.jpg', '23.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(29, 5, 'Smoking Wood Dust Variety Pack', 'Smoke-roasting refers to any process that has the attributes of both roasting and smoking. This smoking method is sometimes referred to as barbecuing or pit-roasting. It may be done in a smoke-roaster, a closed wood-fired oven, or a barbecue pit, any smoker that can reach above 121 °C (250 °F), or in a conventional oven (one that a person does not mind having smoky all the time) by placing a pan filled with hardwood chips on the floor of the oven so that the chips can smolder and produce a smoke-bath.[14] In North America, this smoking method is commonly referred to as \"barbecuing\", \"pit baking\", or \"pit roasting\".', 'smoking-wood-dust-variety-pack', 'smoking-wood-dust-variety-pack.jpg', '13.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(30, 5, 'Hickory Cooking and Smoking Wood Chunks', 'Hardwoods are made up mostly of three materials: cellulose, hemicellulose, and lignin. Cellulose and hemicellulose are the basic structural material of the wood cells; lignin acts as a kind of cell-bonding glue. Some softwoods, especially pines and firs, hold significant quantities of resin, which produces a harsh-tasting soot when burned; these woods are not often used for smoking.\r\n\r\nCellulose and hemicellulose are aggregate sugar molecules; when burnt, they effectively caramelize, producing carbonyls, which provide most of the color components and sweet, flowery, and fruity aromas. Lignin, a highly complex arrangement of interlocked phenolic molecules, also produces a number of distinctive aromatic elements when burnt, including smoky, spicy, and pungent compounds such as guaiacol, phenol, and syringol, and sweeter scents such as the vanilla-scented vanillin and clove-like isoeugenol. Guaiacol is the phenolic compound most responsible for the \"smoky\" taste, while syringol is the primary contributor to smoky aroma.[15] Wood also contains small quantities of proteins, which contribute roasted flavors. Many of the odor compounds in wood smoke, especially the phenolic compounds, are unstable, dissipating after a few weeks or months.', 'hickory-cooking-and-smoking-wood-chunks', 'hickory-cooking-and-smoking-wood-chunks.jpg', '41.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(31, 5, 'Alder Smoking Wood Chips Natural and Untreated (Small Cut)', 'A number of wood smoke compounds act as preservatives. Phenol and other phenolic compounds in wood smoke are both antioxidants, which slow rancidification of animal fats, and antimicrobials, which slow bacterial growth. Other antimicrobials in wood smoke include formaldehyde, acetic acid, and other organic acids, which give wood smoke a low pH—about 2.5. Some of these compounds are toxic to people as well, and may have health effects in the quantities found in cooking applications.', 'alder-smoking-wood-chips-natural-and-untreated-small-cut', 'alder-smoking-wood-chips-natural-and-untreated-small-cut.jpg', '9.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(32, 5, 'Smoking Wood Chips for BBQ (Cherry)', 'Since different species of trees have different ratios of components, various types of wood do impart a different flavor to food. Another important factor is the temperature at which the wood burns. High-temperature fires see the flavor molecules broken down further into unpleasant or flavorless compounds. The optimal conditions for smoke flavor are low, smoldering temperatures between 300 and 400 °C (570 and 750 °F). This is the temperature of the burning wood itself, not of the smoking environment, which uses much lower temperatures. Woods that are high in lignin content tend to burn hot; to keep them smoldering requires restricted oxygen supplies or a high moisture content. When smoking using wood chips or chunks, the combustion temperature is often raised by soaking the pieces in water before placing them on a fire.', 'smoking-wood-chips-for-bbq-cherry', 'smoking-wood-chips-for-bbq-cherry.jpg', '11.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(33, 6, 'DALSTRONG Chef Knife - Gladiator Series - German HC Steel - 8\" (200mm)', 'In cooking, a chef\'s knife, also known as a cook\'s knife, is a cutting tool used in food preparation. The chef\'s knife was originally designed primarily to slice and disjoint large cuts of beef. Today it is the primary general-utility knife for most western cooks.\r\n\r\nA chef\'s knife generally has a blade eight inches (20 centimeters) in length and 1 1⁄2 inches (3.8 cm) in width, although individual models range from 6 to 14 inches (15 to 36 centimetres) in length. There are two common types of blade shape in western chef\'s knives, French and German. German-style knives are more deeply and continuously curved along the whole cutting edge; the French style has an edge that is straighter until the end and then curves up to the tip.\r\n\r\nA Japanese gyuto (牛刀 ぎゅうとう） gyūtō), literally meaning \'beef knife\', is the Japanese version of a French (or Western) chef\'s knife.\r\n\r\nThe Santoku knife is basically a Japanese style chef\'s knife. It\'s smaller lighter sharper with a different blade shape.\r\n\r\nThe Chinese chef\'s knife is completely different and resembles a cleaver.\r\n\r\nA modern chef\'s knife is a multi-purpose knife designed to perform well at many differing kitchen tasks, rather than excelling at any one in particular. It can be used for mincing, slicing, and chopping vegetables, slicing meat, and disjointing large cuts.', 'dalstrong-chef-knife-gladiator-series-German-hc-steel-8-200mm', 'dalstrong-chef-knife-gladiator-series-German-hc-steel-8-200mm.png', '145.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(34, 6, 'Mercer Culinary Genesis 8-Inch Stainless Steel', 'Chef\'s knives are made with blades that are either forged or stamped:\r\n\r\nForged: A hand forged blade is made in a multi-step process by skilled manual labor. A blank of steel is heated to a high temperature, and beaten to shape the steel. After forging, the blade is ground and sharpened. Forged knives are usually also full-tang, meaning the metal in the knife runs from the tip of the knifepoint to the far end of the handle. Commercially made forged knives are struck in a power hammer to produce features such as the bolster.\r\nStamped: A stamped blade is cut to shape directly from cold rolled steel, heat-treated for strength and temper, then ground, sharpened, and polished.[1]\r\nThe blade of a chef\'s knife is typically made of carbon steel, stainless steel, a laminate of both metals, or ceramic:\r\n\r\nCarbon steel: An alloy of iron and approximately 1% carbon. Most carbon steel chef\'s knives are simple carbon iron alloys without exotic additions such as chrome or vanadium. Carbon steel blades are both easier to sharpen than ordinary stainless steel and usually hold an edge longer, but are vulnerable to rust and stains. Some professional cooks swear by knives of carbon steel because of their sharpness. Over time, a carbon-steel knife will normally acquire a dark patina, and can rust or corrode if not cared for properly by cleaning and lubricating the blade after use. Some chefs also \'rest\' their carbon-steel knives for a day after use in order to restore the oxidizing patina, which prevents transfer of metallic tastes to some foods. While some cooks prefer and use carbon steel knives (especially in Asia and the Middle East), others find carbon steel too maintenance-intensive in a kitchen environment.[citation needed]', 'mercer-culinary-genesis-8-inch-stainless-steel', 'mercer-culinary-genesis-8-inch-stainless-steel.jpg', '362.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(35, 6, 'Clauss 18424 Stainless Steel Straight Knife', 'The Santoku bōchō (Japanese: 三徳包丁; \"three virtues\" or \"three uses\") or Bunka bōchō (文化包丁) is a general-purpose kitchen knife originating in Japan. Its blade is typically between 13 and 20 cm (5 and 8 in) long, and has a flat edge and a sheepsfoot blade that curves in an angle approaching 60 degrees at the point. The word may refer to the wide variety of ingredients that a Santoku knife can handle: meat, fish and vegetables, or to the tasks it can perform: slicing, chopping and dicing, either interpretation indicating a multi-use, general-purpose kitchen knife. The Santoku\'s blade and handle are designed to work in harmony by matching the blade\'s width/weight to the weight of blade tang and handle, as with the original Japanese Santoku.', 'clauss-18424-stainless-steel-straight-knife', 'clauss-18424-stainless-steel-straight-knife.jpg', '912.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(36, 6, 'Japanese Nakiri Kitchen Knife TERUHIDE Wooden Handle Carbon Steel', 'San Mai (Japanese: 三枚 Hepburn: sanmai), in the context of metal blade construction/metalwork, refers to a knife, blade or sword that has the hard steel hagane forming the blade\'s edge, and the iron/stainless forming a jacket on both sides. It is also the term used to refer to the technique used to create these blades.[1]\r\n\r\nIn stainless versions, this offers a practical and visible advantage of a superb cutting edge of modern Japanese knife steel, with a corrosion-resistant exterior. In professional Japanese kitchens, the edge is kept free of corrosion and knives are generally sharpened on a daily basis. Corrosion can be avoided by keeping the exposed portion of the non-stainless portion of the blade clean and dry after each use.\r\n\r\n\"San mai\" roughly translates as three flat things, in Japanese (San=three Mai=unit counter for flat objects). The term, and its root honsanmai, has been used to describe that construction method for many hundreds of years, from around 1300 A.D. It refers to when three layers of steel are used. The center is hard, and the side is typically softer.', 'japanese-nakiri-kitchen-knife-wooden-handle-carbon-steel', 'japanese-nakiri-kitchen-knife-wooden-handle-carbon-steel.png', '95.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(37, 6, 'Japanese Yanagiba Kitchen Knife TERUHIDE Wood Handle sushi sashimi Carbon Japan', 'Carbon steel is an alloy of iron and carbon, often including other elements such as vanadium and manganese. Carbon steel commonly used in knives has around 1.0% carbon (ex. AISI 1095), is inexpensive, and holds its edge well. Carbon steel is normally easier to resharpen than many stainless steels, but is vulnerable to rust and stains. The blades should be cleaned, dried, and lubricated after each use. New carbon-steel knives may impart a metallic or \"iron\" flavour to acidic foods, though over time, the steel will acquire a patina of oxidation which will prevent corrosion. Good carbon steel will take a sharp edge, but is not so hard as to be difficult to sharpen, unlike some grades of stainless steel.', 'japanese-yanagiba-kitchen-knife-wood-handle-sushi-sashimi-carbon', 'japanese-yanagiba-kitchen-knife-wood-handle-sushi-sashimi-carbon.jpg', '511.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(38, 11, 'Jealous Devil All Natural Hardwood Lump Charcoal - 35LB', 'Charcoal is a lightweight black carbon residue produced by removing water and other volatile constituents from animal and plant materials. Charcoal is usually produced by slow pyrolysis—the heating of wood or other organic materials in the absence of oxygen. This process is called charcoal burning. The finished charcoal consists largely of carbon.\r\n\r\nThe advantage of burning charcoal compared to burning wood is the absence of water and other components. This allows charcoal to burn at higher temperatures, and give off very little smoke (regular wood releases a significant amount of steam, organic volatiles, and unburnt carbon particles—soot—in its smoke).', 'jealous-devil-all-natural-hardwood-lump-charcoal-35lb', 'jealous-devil-all-natural-hardwood-lump-charcoal-35lb.jpg', '10.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(39, 11, 'Bayou Classic 500-416, 16-lbs Bag Natural Charcoal Briquets', 'The production of wood charcoal in locations where there is an abundance of wood dates back to a very ancient period. It generally begins with piling billets of wood on their ends so as to form a conical pile. Openings are left at the bottom to admit air, with a central shaft to serve as a flue. The whole pile is covered with turf or moistened clay. The firing is begun at the bottom of the flue, and gradually spreads outwards and upwards. The success of the operation depends upon the rate of the combustion. Under average conditions wood yields about 60% charcoal by volume, or 25% by weight; small-scale production methods often yield only about 50% by volume, while large-scale methods enabled higher yields of about 90% even by the seventeenth century. The operation is so delicate that it was generally left to colliers (professional charcoal burners). They often lived alone in small huts in order to tend their wood piles. For example, in the Harz Mountains of Germany, charcoal burners lived in conical huts called Köten which are still much in evidence today', 'bayou-classic-500-416-16-lbs-bag-natural-charcoal-briquets', 'bayou-classic-500-416-16-lbs-bag-natural-charcoal-briquets.jpg', '20.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(40, 11, 'Kamado Joe KJ-Char Hardwood, Extra Large Lump Charcoal', 'The massive production of charcoal (at its height employing hundreds of thousands, mainly in Alpine and neighbouring forests) was a major cause of deforestation, especially in Central Europe.[when?] In England, many woods were managed as coppices, which were cut and regrown cyclically, so that a steady supply of charcoal would be available. Complaints (as early as the Stuart period) about shortages may relate to the results of temporary over-exploitation or the impossibility of increasing production to match growing demand. The increasing scarcity of easily harvested wood was a major factor behind the switch to fossil fuel equivalents, mainly coal and brown coal for industrial use.', 'kamado-joe-kj-char-hardwood-extra-large-lump-charcoal', 'kamado-joe-kj-char-hardwood-extra-large-lump-charcoal.jpg', '30.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(41, 11, 'CHARBLOX Ultra Premium Hardwood Grilling Charcoal Logs', 'The modern process of carbonizing wood, either in small pieces or as sawdust in cast iron retorts, is extensively practiced where wood is scarce, and also for the recovery of valuable byproducts (wood spirit, pyroligneous acid, wood tar), which the process permits. The question of the temperature of the carbonization is important; according to J. Percy, wood becomes brown at 220 °C (428 °F), a deep brown-black after some time at 280 °C (536 °F), and an easily powdered mass at 310 °C (590 °F).[1] Charcoal made at 300 °C (572 °F) is brown, soft and friable, and readily inflames at 380 °C (716 °F); made at higher temperatures it is hard and brittle, and does not fire until heated to about 700 °C (1,292 °F).', 'charblox-ultra-premium-hardwood-grilling-charcoal-logs', 'charblox-ultra-premium-hardwood-grilling-charcoal-logs.jpg', '40.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(42, 11, 'Kingsford 18.6 lbs. Charcoal Briquettes', 'in Finland and Scandinavia, the charcoal was considered the by-product of wood tar production. The best tar came from pine, thus pinewoods were cut down for tar pyrolysis. The residual charcoal was widely used as substitute for metallurgical coke in blast furnaces for smelting. Tar production led to rapid local deforestation. The end of tar production at the end of the 19th century resulted in rapid re-forestation of affected areas.\r\n\r\nThe charcoal briquette was first invented and patented by Ellsworth B. A. Zwoyer of Pennsylvania in 1897[2] and was produced by the Zwoyer Fuel Company. The process was further popularized by Henry Ford, who used wood and sawdust byproducts from automobile fabrication as a feedstock. Ford Charcoal went on to become the Kingsford Company.', 'kingsford-18.6-lbs-charcoal-briquettes', 'kingsford-18.6-lbs-charcoal-briquettes.jpg', '50.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(43, 12, 'Wooden Salt and Pepper Grinder', 'Salt is a mineral consisting primarily of sodium chloride (NaCl), a chemical compound belonging to the larger class of salts; salt in its natural form as a crystalline mineral is known as rock salt or halite. Salt is present in vast quantities in seawater, where it is the main mineral constituent. The open ocean has about 35 grams (1.2 oz) of solids per liter of sea water, a salinity of 3.5%.\r\n\r\nSalt is essential for life in general, and saltiness is one of the basic human tastes. Salt is one of the oldest and most ubiquitous food seasonings, and salting is an important method of food preservation.', 'wooden-salt-and-pepper-grinder', 'wooden-salt-and-pepper-grinder.jpg', '32.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(44, 12, 'KitchenAid Textured Aluminum Meat Tenderizer, 9.5-Inch', 'A meat tenderizer, meat mallet, or meat pounder is a hand-powered tool used to tenderize slabs of meat in preparation for cooking. Although a meat tenderizer can be made out of virtually any object, there are three types manufactured specifically for tenderizing meat.\r\n\r\nThe first, most common, is a tool that resembles a hammer or mallet made of metal or wood with a short handle and dual heads. One face of the tool is usually flat while the other has rows of pyramid-shaped tenderizers.\r\nThe second form resembles a potato masher with a short handle and a large metal face that is either smooth or adorned with the same pyramid-shaped tenderizers as found in the first form.\r\nThe third form is a blade tenderizer that has a series of blades or nails that are designed to puncture the meat and cut into the fibers of the muscle.', 'kitchenaid-textured-aluminum-meat-tenderizer-9.5-inch', 'kitchenaid-textured-aluminum-meat-tenderizer-9.5-inch.jpg', '14.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(45, 12, 'Granite Mortar and Pestle by HiCoup - Natural Unpolished', 'Mortar and pestle are implements used since ancient times to prepare ingredients or substances by crushing and grinding them into a fine paste or powder in the kitchen, laboratory, and pharmacy. The mortar (/ˈmɔːrtər/) is a bowl, typically made of hard wood, metal, ceramic, or hard stone, such as granite. The pestle (/ˈpɛsəl/, also US: /ˈpɛstəl/) is a heavy and blunt club-shaped object. The substance to be ground, which may be wet or dry, is placed in the mortar, where the pestle is pressed and rotated onto it until the desired texture is achieved.', 'granite-mortar-and-pestle-by-hicoup-natural-unpolished', 'granite-mortar-and-pestle-by-hicoup-natural-unpolished.jpg', '41.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(46, 12, 'EXTRA LARGE Organic Bamboo Cutting Board', 'A cutting or chopping board is a durable board on which to place material for cutting. The kitchen cutting board is commonly used in preparing food; other types exist for cutting raw materials such as leather or plastic. Kitchen cutting boards are often made of wood or plastic and come in various widths and sizes. There are also cutting boards made of glass, steel, or marble, which are easier to clean than wooden or plastic ones such as nylon or corian, but tend to damage knives due to their hardness. Rough cutting edges—such as serrated knives—abrade and damage a cutting surface more rapidly than do smooth cutting implements.', 'extra large organic-bamboo-cutting-board', 'extra large organic-bamboo-cutting-board.jpg', '9.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(47, 12, 'Anpro Grilling Accessories BBQ Tools Set', 'Grilling is a form of cooking that involves dry heat applied to the surface of food, commonly from above, below or from the side.[1] Grilling usually involves a significant amount of direct, radiant heat, and tends to be used for cooking meat and vegetables quickly. Food to be grilled is cooked on a grill (an open wire grid such as a gridiron with a heat source above or below), using a cast iron/frying pan, or a grill pan (similar to a frying pan, but with raised ridges to mimic the wires of an open grill).', 'anpro-grilling-accessories-bbq-tools-set', 'anpro-grilling-accessories-bbq-tools-set.png', '25.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(48, 13, 'JL Masters All Natural Meat Rub - Beef - 3 (three) 3.8oz packages', 'Spice rub is any mixture of ground spices that is made for the purpose of being rubbed on raw food before the food is cooked. The spice rub forms a coating on the food. The food can be marinated in the spice rub for some time for the flavors to incorporate into the food or it can be cooked immediately after it is coated in the rub. The spice rub can be left on or partially removed before cooking.', 'jl-masters-all-natural-meat-rub-beef-3-three-3.8oz-packages', 'jl-masters-all-natural-meat-rub-beef-3-three-3.8oz-packages.jpg', '21.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(49, 13, 'Cholula Original Hot Sauce', 'Cholula Hot Sauce is a brand of chili-based hot sauce, based in Stamford, Connecticut, manufactured in Chapala, Jalisco, Mexico, and licensed by José Cuervo. According to its manufacturers, Cholula hot sauce rates 500–1,000 on the Scoville scale[2] though other sources measure it as being over three times hotter, at 3,600 Scoville units.[3] The product is packaged in glass bottles with an iconic round wooden cap. Six varieties of Cholula are widely marketed in North America, including Original, Chipotle, Chili Garlic, Chili Lime, Green Pepper, and Sweet Habanero.[4]', 'cholula-original-hot-sauce', 'cholula-original-hot-sauce.png', '9.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(50, 13, 'ketchup', 'Tomato ketchup, also known as catsup, ketsup, red sauce, and tomato sauce, is a sauce used as a condiment. Originally, recipes used egg whites, mushrooms, oysters, grapes, mussels, or walnuts, among other ingredients,[1][2] but now the unmodified term usually refers to tomato ketchup.[3]\r\n\r\nTomato ketchup is a sweet and tangy sauce now made from tomatoes, sugar, and vinegar, with seasonings and spices. The spices and flavors vary, but commonly include onions, allspice, coriander, cloves, cumin, garlic, and mustard, and sometimes include celery, cinnamon, or ginger.[4]\r\n\r\nThe market leader in the United States (60% market share) and United Kingdom (82%) is Heinz.[5][6] Hunt\'s has the second biggest share of the US market with less than 20%. In much of the UK, Australia, and New Zealand, ketchup is also known as \"tomato sauce\" (a term that means a fresher pasta sauce elsewhere in the world) or \"red sauce\" (especially in Wales).\r\n\r\nTomato ketchup is most often used as a condiment to dishes that are usually served hot and may be fried or greasy: french fries, hamburgers, hot dogs, chicken tenders, tater tots, hot sandwiches, meat pies, cooked eggs, and grilled or fried meat. Ketchup is sometimes used as the basis for, or as one ingredient in, other sauces and dressings, and the flavor may be replicated as an additive flavoring for snacks, such as potato chips.', 'ketchup', 'ketchup.jpg', '18.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(51, 13, 'Mustard', 'Mustard is a condiment made from the seeds of a mustard plant (white/yellow mustard, Sinapis alba; brown/Indian mustard, Brassica juncea; or black mustard, Brassica nigra).\r\n\r\nThe whole, ground, cracked, or bruised mustard seeds are mixed with water, vinegar, lemon juice, wine, or other liquids, salt, and often other flavorings and spices, to create a paste or sauce ranging in color from bright yellow to dark brown. The taste of mustard ranges from sweet to spicy.[1]\r\n\r\nCommonly paired with meats and cheeses, mustard is also added to sandwiches, hamburgers, corn dogs, and hot dogs. It is also used as an ingredient in many dressings, glazes, sauces, soups, and marinades. As a cream or as individual seeds, mustard is used as a condiment in the cuisine of India and Bangladesh, the Mediterranean, northern and southeastern Europe, Asia, the Americas, and Africa,[2] making it one of the most popular and widely used spices and condiments in the world.[3]', 'mustard', 'mustard.jpg', '21.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
(52, 13, 'Killer Hogs The BBQ Rub 12 Ounce', 'The spices are usually coarsely ground. In addition to spices, salt and sugar may be added to the rub, the salt for flavor and the sugar for caramelization. Different salts are sometimes used for their unique qualities, such as Himalayan pink salt. The simplest rub is just coarsely ground black pepper as in steak au poivre.\r\n\r\nSpice rubs can also have ingredients such as herbs, crushed garlic or oil added to make a paste.\r\n\r\nLess common ingredients can include coffee beans.[1]', 'killer-hogs-the-bbq-rub-12-ounce', 'killer-hogs-the-bbq-rub-12-ounce.jpg', '16.00', '2019-12-02 00:00:00', '2019-12-02 00:00:00'),
